(1240, 130, 'ket_cau', 'Sân trước, phòng khách, phòng bếp, phòng ngủ, nhà vệ sinh. Nhà nằm trong khu văn minh ngay tại trung tâm thị trấn Nhà Bè.\r\nTiện ích xung quanh đầy đủ : gần chợ Phú Xuân, gần trường học, ngân hàng, siêu thị, cửa hàng tiện lợi,..\r\nVị trí cực kỳ đẹp, phù hợp mua ở, kinh doanh mọi ngành nghề như: tiệm tóc, nail, tạp hóa hoặc cho thuê..\r\nDễ dàng kết nối đến các quận trung tâm quận 7, quận 1 trong chỉ 5-10 phút đi xe...'),
