(1, 1, '2020-10-11 14:51:13', '2020-10-11 14:51:13', '<!-- wp:paragraph -->\n<p>Chị gái chuyển công tác muốn bán nhanh Nhà Mặt tiền Phú Lộc 5 Nhà đẹp, thiết kế hiện đại, kiên cố Diện tích 75m xây 2 tầng Diện tích sử dụng 150m Nhà gồm 3 phòng ngủ, 3 WC, phòng khách, phòng thờ, bếp, sân phơi Sân để ô tô. nhà hướng đông bắc, đẹp Gần cạnh Đh FPT Đà nẵng Cách biển NTT 500m đi bộ, gần chợ Phú LỘc, NGuyễn Sinh Sắc.. Nhà chính chủ, xem là thích Liên hệ: 0935110880</p>\n<!-- /wp:paragraph -->', 'Nhà Phú Lộc 5, ngay cạnh trường ĐH FPT Đà Nẵng', '', 'trash', 'open', 'open', '', 'hello-world__trashed', '', '', '2020-11-06 16:25:15', '2020-11-06 16:25:15', '', 0, 'https://yenthinhbds.vn//?p=1', 0, 'post', '', 1),
(2, 1, '2020-10-11 14:51:13', '2020-10-11 14:51:13', '<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like piña coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"https://yenthinhbds.vn//wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->', 'Liên Hệ', '', 'publish', 'closed', 'closed', '', 'lien-he', '', '', '2020-11-08 13:29:35', '2020-11-08 13:29:35', '', 0, 'https://yenthinhbds.vn//?page_id=2', 0, 'page', '', 0),
(3, 1, '2020-10-11 14:51:13', '2020-10-11 14:51:13', '<!-- wp:paragraph -->\n<p>Chúng tôi sẽ cập nhập sau.</p>\n<!-- /wp:paragraph -->', 'Giới Thiệu', '', 'publish', 'closed', 'closed', '', 'gioi-thieu', '', '', '2020-11-06 16:13:40', '2020-11-06 16:13:40', '', 0, 'https://yenthinhbds.vn//?page_id=3', 0, 'page', '', 0),
