(51, 1, '2020-10-13 16:06:19', '2020-10-13 16:06:19', '<!-- wp:paragraph -->\n<p>Chị gái chuyển công tác muốn bán nhanh Nhà Mặt tiền Phú Lộc 5 Nhà đẹp, thiết kế hiện đại, kiên cố Diện tích 75m xây 2 tầng Diện tích sử dụng 150m Nhà gồm 3 phòng ngủ, 3 WC, phòng khách, phòng thờ, bếp, sân phơi Sân để ô tô. nhà hướng đông bắc, đẹp Gần cạnh Đh FPT Đà nẵng Cách biển NTT 500m đi bộ, gần chợ Phú LỘc, NGuyễn Sinh Sắc.. Nhà chính chủ, xem là thích Liên hệ: 0935110880</p>\n<!-- /wp:paragraph -->', 'Nhà Phú Lộc 5, ngay cạnh trường ĐH FPT Đà Nẵng', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2020-10-13 16:06:19', '2020-10-13 16:06:19', '', 1, 'https://yenthinhbds.vn//2020/10/13/1-revision-v1/', 0, 'revision', '', 0),
(53, 1, '2020-10-13 16:14:44', '2020-10-13 16:14:44', '<!-- wp:paragraph -->\n<p>Cho thuê nhà 3 tầng nguyên căn Mặt tiền đường An Nhơn 1 , Quận Sơn Trà. gần cầu Sông hàn.<br>– Vị trí: Khu tập dân cư yên tĩnh, 5 phút đi bộ đến cầu sông Hàn và cách biển chỉ 200m.<br>– Nhà 3 tầng gồm phòng khách rộng, nhà bếp, sân trước, 3 PN lớn có gắn máy lạnh, 3wc.<br>– Nhà có nội thất gỗ cao cấp sang trọng, tủ lạnh, máy giặt, điều hoà và cả hệ thống nước nóng năng lượng mặt trời.<br>– Diện tích đất : 4.5m x 20m<br>– Diện tích sử dụng 180m2.<br>– Giá cho thuê : 19 triệu/ tháng<br>– Cọc 1 tháng , thanh toán 6 tháng, Ưu tiên cho thuê lâu dài.</p>\n<!-- /wp:paragraph -->', 'Cho thuê nhà 3 tầng đường An Nhơn 1, Quận Sơn Trà. Gần cầu Sông Hàn.', '', 'trash', 'open', 'open', '', 'cho-thue-nha-3-tang-duong-an-nhon-1-quan-son-tra-gan-cau-song-han__trashed', '', '', '2020-11-06 16:25:13', '2020-11-06 16:25:13', '', 0, 'https://yenthinhbds.vn//?p=53', 0, 'post', '', 0),
