(66, 1, '2020-10-13 16:23:12', '2020-10-13 16:23:12', '<!-- wp:paragraph -->\n<p>Khu đô thị PGT City do PGT Group làm chủ sở hữu, do PGT Land- Công ty thành viên của PGT Group phân phối độc quyền. Vị trí: Nằm trên 2 trục đường lớn Nguyễn Sinh Sắc và Hoàng Thị Loan, đối diện Trung tâm Hành chính quận Liên Chiểu, Đà Nẵng. Loại hình phát triển: Nhà phố liền kề, trung tâm kinh tế mới quận Liên Chiểu (shop house, nhà hàng, ngân hàng, nhà hàng tiệc cưới …) Pháp lý: Đã có sổ đỏ từng lô. Khách hàng đi công chứng nhận sổ sau 06 tháng kể từ ngày ký hợp đồng cọc. Nhận giữ chỗ 100 triệu/ lô cam kết không mua HOÀN TIỀN 100% Sau 3 ngày mở bán Thanh toán linh hoạt chỉ từ 20% giá trị HĐ Nhận tái đầu tư ngay khi khách hàng lên hợp đồng. Giá bán: từ 28,5- 70 triệu/m2 LIÊN HỆ: Tập đoàn Bất động sản PGT Group Đơn vị phân phối độc quyền: PGT Land Hotline: 0944.646.527</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Giá:&nbsp;28 triệu /&nbsp;m<sup>2</sup>&nbsp;&nbsp;Diện tích:&nbsp;100 m<sup>2</sup>Địa chỉ tài sản:&nbsp;24 Đường Nguyễn Sinh Sắc, Phường Hòa Minh, Quận Liên Chiểu, Đà Nẵng</p>\n<!-- /wp:paragraph -->', 'Đất nền ven biển Nguyễn Tất Thành-trung tâm quận Liên Chiểu Đà Nẵng', '', 'inherit', 'closed', 'closed', '', '62-revision-v1', '', '', '2020-10-13 16:23:12', '2020-10-13 16:23:12', '', 62, 'https://yenthinhbds.vn//2020/10/13/62-revision-v1/', 0, 'revision', '', 0),
(67, 1, '2020-10-13 16:26:27', '2020-10-13 16:26:27', '<!-- wp:paragraph -->\n<p>Căn Hộ Đà Nẵng SƠN TRÀ OCEAN VIEW:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>– Là tổ hợp căn hộ du lịch nghĩ dưỡng đẳng cấp 5* quy mô toàn diện tại ĐÀ NẴNG.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>– Dự án căn hộ Sơn Trà Ocean View tọa lạc tại điểm đầu Bán Đảo Sơn Trà nằm trên cung đường Ngô Quyền nối liền cảng Tiên Sa với phố cổ Hội An, từ dự án chỉ mất khoảng 5 phút để đến trung tâm hành chính TP ĐÀ NẴNG và vài bước chân để đến biển đẹp nhất hành tinh.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Hệ thống tiện ích:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>-Bể bơi trên không.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>-Khu vực shop house với chuỗi các cửa hàng và siêu thị</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>-Liền sát quần thể căn hộ, Resort được đánh giá đẹp nhất ĐÔNG NAM Á</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Giá trị đầu tư và các ưu đãi cho các khách hàng sở hữu căn hộ nghĩ dưỡng Sơn Trà Ocean View:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>-Cam kết sinh lời tối thiểu 100% trong 10 năm</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>-Kì vọng tăng giá tài sản trong tương lai</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>-Gói ưu đãi tài chính hỗ trợ đến 70% giá trị căn hộ</p>\n<!-- /wp:paragraph -->', 'Căn Hộ Đà Nẵng SƠN TRÀ OCEAN VIEW', '', 'trash', 'open', 'open', '', 'can-ho-da-nang-son-tra-ocean-view__trashed', '', '', '2020-11-06 16:25:08', '2020-11-06 16:25:08', '', 0, 'https://yenthinhbds.vn//?p=67', 0, 'post', '', 0),
