(71, 1, '2020-10-13 16:30:11', '2020-10-13 16:30:11', '<!-- wp:paragraph -->\n<p>Golden Hills có vị trí đắc địa, là cửa ngõ phía Tây Bắc thành phố Đà Nẵng, thuộc huyện Hòa Vang và quận Liên Chiểu. Phía Tây giáp đường cao tốc Hải Vân Dung Quốc, phía Đông là khu dân cư, phía Bắc là sông Cu Đê và phía Nam giáp đường Nguyễn Tất Thành nối dài. Dự án cách trung tâm Đà Nẵng 10km, là điểm nhấn trong chiến lược phát triển kinh tế xã hội về phía Tây Bắc của thành phố Đà Nẵng.</p>\n<!-- /wp:paragraph -->', 'Golden hill Quận Liên Chiểu, Đà Nẵng', '', 'trash', 'open', 'open', '', 'golden-hill-quan-lien-chieu-da-nang__trashed', '', '', '2020-11-06 16:25:05', '2020-11-06 16:25:05', '', 0, 'https://yenthinhbds.vn//?p=71', 0, 'post', '', 0),
