(80, 1, '2020-10-13 16:40:08', '2020-10-13 16:40:08', '<!-- wp:paragraph -->\n<p>Bán lô cặp mặt tiền đường 10m5 -Bùi Tấn Diên, KDT Phước Lý, diện tích 5x22m = 110m2 một lô, 2lô 220m2.<br>Sổ đỏ chính chủ, không qua trung gian.<br>Lô cặp mặt tiền trục đường chính, đẹp KĐT Phước Lý, đông dân cư, đằng sau lưng bến xe, gần khu đơn vị bộ đội 375, an ninh tốt, gần trường đại học Duy Tân thuận lợi kinh doanh cafe, quán nhậu, siêu thị.<br>Đường 10m5, lề 4m.<br>Giá bán lẻ 1 lô 2 tỷ1 / lô. 2 lô 4tỷ150.</p>\n<!-- /wp:paragraph -->', 'Bán lô cặp đường 10m5 Bùi Tấn Diên, KDT Phước Lý', '', 'trash', 'open', 'open', '', 'ban-lo-cap-duong-10m5-bui-tan-dien-kdt-phuoc-ly__trashed', '', '', '2020-11-15 14:54:00', '2020-11-15 14:54:00', '', 0, 'https://yenthinhbds.vn//?p=80', 0, 'post', '', 0),
