(104, 1, '2020-10-23 14:19:51', '2020-10-23 14:19:51', '<!-- wp:paragraph -->\n<p>I)ĐẤT KHU ĐÔ THỊ NAM HÒA XUÂN (đường 7.5m lề 3,5m; dt=105=&gt;110m2)<br>– Tây bắc: B2-87 lô 22 giá 1,6 tỷ đường 10.5m; b2-56 lô 46 có sổ giá 1,6 tỷ; B2-72 lô 23 giá 1,65 tỷ; B2-96 lô 20 giá 1,34 tỷ; B2-55 lô 44 giá 2,17 tỷ đường thông 10.5m; B2-94 lô 17;18 giá 1,5 tỷ; B2-75 lô 8;9 giá 1,7 tỷ; B2-58 lô 4 giá 1,61 tỷ gần TTTM và đại lô Minh Mạng.<br>– Đông Nam: B2-55 lô 100 giá 1,65 tỷ; B2-135 lô 84 giá 1,8 tỷ; B2-99 lô 87 giá 1,45 tỷ đường thông; B2-88 lô 82 giá 1,46 tỷ; B2-72 lô 6x giá 1,64 tỷ; B2-65 lô 36 giá 1,8 tỷ; B2-93 lô 54 giá 1,55 tỷ; B2-68 lô 44 giá 1,75 tỷ đối diện trường; B2-43 lô 49;50 giá 1,87 tỷ đường thông đấu lưng Minh Mạng.<br>– Đông Bắc: B2-31 lô 12 giá 1,8 tỷ<br>– Tây Nam: B2-61 lô 15 dt 122,5m2 sạch đẹp giá 2,15 tỷ đối lưng đại lộ Nguyễn Phước Lan.<br>II) ĐẤT KHU ĐÔ THỊ SINH THÁI HÒA XUÂN<br>– Tây Bắc: B1-69 lô 36 giá 2,1 tỷ đường thông HXMR; B1-78 lô 106 giá 2 tỷ.<br>– Đông Nam: B1-126 lô 3 giá 2,2 tỷ.<br>– Đông Bắc: B1-149 lô 15 giá 1,8 tỷ; B1-3 lô 44;45 đảo víp giá 2,7 tỷ dt 121m2<br>– Tây Nam: B1-129 lô 6 giá 2,35 tỷ; B1-3 lô 31;32 giá 2,7 tỷ dt=121m2 đối diện trường học.<br>III) ĐẤT MỠ BÁN MỚI<br>1) BIỆT THỰ HÒA XUÂN MỞ RỘNG 10/05/2018 ck 8%.<br>IV) CẦN THU MUA<br>1) ĐẤT KHU ĐÔ THỊ SINH THÁI HÒA XUÂN MƠ RỘNG<br>2) ĐẤT KHU ĐÔ THỊ NAM HÒA XUÂN ( B2-64; B2-65; B2-66; B2-67; B2-68; B2-69; B2-70; B2-71; B2-72; B2-73; B2-74; B2-75; B2-76 …)<br>VỊ TRÍ VĂN PHÒNG GIAO DỊCH BĐS ĐẠI DIỆN NAM HÒA XUÂN B2-76 LÔ 2MT 78</p>\n<!-- /wp:paragraph -->', 'Đất khu đô thị sinh thái Hòa Xuân - Demo', '', 'inherit', 'closed', 'closed', '', '90-revision-v1', '', '', '2020-10-23 14:19:51', '2020-10-23 14:19:51', '', 90, 'https://yenthinhbds.vn//2020/10/23/90-revision-v1/', 0, 'revision', '', 0),
