(115, 1, '2020-10-27 14:58:24', '2020-10-27 14:58:24', '<div class=\"row\"><div class=\"col-xs-12 col-sm-12 col-md-12 col-lg-12\"><span class=\"wpcf7-form-control-wrap name_contact\">[text* your-name placeholder class:form-control \"Họ và Tên\"]</span> </div><div class=\"col-xs-12 col-sm-12 col-md-12 col-lg-6\"><span class=\"wpcf7-form-control-wrap email\">[email* your-email class:form-control placeholder \"Email\"]</span></div><div class=\"col-xs-12 col-sm-12 col-md-12 col-lg-6\"><span class=\"wpcf7-form-control-wrap phone\">[tel* your-phone class:form-control placeholder \"Số điện thoại\"]</span></div><div class=\"col-xs-12 col-sm-12 col-md-12 col-lg-12\"><span class=\"wpcf7-form-control-wrap title_contact\">[text* your-subject class:form-control placeholder \"Tiêu đề\"]</span> </div><div class=\"col-xs-12 col-sm-12 col-md-12 col-lg-12\"><span class=\"wpcf7-form-control-wrap content\">[textarea* your-message class:form-control placeholder \"Nội dung\"]</span> </div><div class=\"col-xs-12 col-sm-12 col-md-12 col-lg-12\">[submit class:contact-button \"Liên hệ ngay\"] </div> </div>\n1\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@timxe.online>\n[_site_admin_email]\nGửi đến từ: [your-name] <[your-email]><[your-phone]>\r\nTiêu đề: [your-subject]\r\n\r\nNội dung thông điệp:\r\n[your-message]\r\n\r\n-- \r\nEmail này được gửi đến từ form liên hệ của website [_site_title] ([_site_url])\nReply-To: [your-email]\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@timxe.online>\n[your-email]\nNội dung thông điệp:\r\n[your-message]\r\n\r\n-- \r\nEmail này được gửi đến từ form liên hệ của website [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nXin cảm ơn, form đã được gửi thành công.\nCó lỗi xảy ra trong quá trình gửi. Xin vui lòng thử lại hoặc liên hệ người quản trị website.\nCó một hoặc nhiều mục nhập có lỗi. Vui lòng kiểm tra và thử lại.\nCó lỗi xảy ra trong quá trình gửi. Xin vui lòng thử lại hoặc liên hệ người quản trị website.\nBạn phải chấp nhận điều khoản trước khi gửi form.\nMục này là bắt buộc.\nNhập quá số kí tự cho phép.\nNhập ít hơn số kí tự tối thiểu.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Contact 1', '', 'publish', 'closed', 'closed', '', 'form-lien-he-1', '', '', '2020-10-27 16:12:58', '2020-10-27 16:12:58', '', 0, 'https://yenthinhbds.vn//?post_type=wpcf7_contact_form&#038;p=115', 0, 'wpcf7_contact_form', '', 0),
